import React from "react";

function Town() {
    return(
        <div className="town">
            <div>
                <div className="roads up" style={{"right": "40%", "bottom": "48%"}}></div>
                <div className="roads cross" style={{"right": "40%", "bottom": "30%"}}></div>
                <div className="roads right" style={{"right": "30%", "bottom": "30%"}}></div>
            </div>
            <div className="shop"></div>
            <div className="academy"></div>

        </div>
    )
}

export default Town
